const { default: styled } = require("styled-components");

const boardListContainer = styled.div`
  margin-top: 150px;
    table {
        width: 60%; 
        marginLeft: auto;
        marginRight: auto;
    }
  .center {
  text-align: center;
  }
`;
export default boardListContainer;
